    "product_details": "#1 NEW YORK TIMES BESTSELLER - A twist you won’t see coming. A love story you’ll never forget. From the acclaimed author of The Notebook comes a powerful novel about risking everything for a dream—and whether it’s possible to leave the past behind.Look for Nicholas Sparks’s new novel, Counting Miracles, available now! A POPSUGAR BEST BOOK OF THE YEARWe don’t always get to choose our paths in life; sometimes they choose us.After fleeing an abusive husband with her six-year-old son, Tommie, Beverly is attempting to create a new life for them in a small town off the beaten track. Despite their newfound freedom, Beverly is constantly on guard: she creates a fake backstory, wears a disguise around town, and buries herself in DIY projects to stave off anxiety. But her stress only rises when Tommie insists he’d been hearing someone walking on the roof and calling his name late at night. With money running out and danger seemingly around every corner, she makes a desperate decision that will rewrite everything she knows to be true. . . . Meanwhile, Colby Mills is on a heart-pounding journey of another kind. A failed musician, he now heads a small family farm in North Carolina. Seeking a rare break from his duties at home, he spontaneously takes a gig playing in a bar in St. Pete Beach, Florida, where he meets Morgan Lee—and his whole life is turned upside-down. The daughter of affluent Chicago doctors, Morgan has graduated from a prestigious college music program with the ambition to move to Nashville and become a star. Romantically and musically, she and Colby complete each other in a way that neither has ever known. In the course of a single unforgettable week, two young people will navigate the exhilarating heights and heartbreak of first love. Hundreds of miles away, Beverly will put her love for her young son to the test. And fate will draw all three people together in a web of life-altering connections . . . forcing each to wonder whether the dream of a better life can ever survive the weight of the past.",
