    "product_details": "Maas 'Maas has established herself as a fantasy fiction titan' Time 'Think Game of Thrones meets Buffy the Vampire Slayer with a drizzle of E.L. James' Telegraph 'Spiced with slick plotting and atmospheric world-building ... a page-turning delight' Guardian 'Sarah J. Maas does not disappoint ... To be devoured with relish' Mail ****** BOUND BY BLOOD. TEMPTED BY DESIRE. UNLEASHED BY DESTINY. Bryce Quinlan loves her life. Every night is a party, and Bryce is going to savour all the pleasures Lunathion - also known as Crescent City - has to offer. But when a brutal murder shakes the very foundations of the city, Bryce's world comes crashing down. Two years later, Bryce still haunts the city's most notorious nightclubs - but seeking only oblivion now. Then the murderer attacks again. And when an infamous Fallen angel, Hunt Athalar, is assigned to watch her every footstep, Bryce knows she can't forget any longer. As Bryce and Hunt fight to unravel the mystery and their own dark pasts, the threads they tug ripple through the underbelly of the city, across warring continents and down to the deepest levels of Hel, where things that have been sleeping for millennia are beginning to stir ... House of Earth and Blood is a blockbuster modern fantasy set in a divided world where one woman must uncover the truth to seek her revenge. Maas delves into the heartache of loss, the price of freedom - and the power of love. *** 5* reader reviews for House of Earth and Blood *** 'I DEVOURED this book. I could not stop gobbling up the words, I loved it so much' 'This book in one word... Epic! And I wholeheartedly mean that! Read it and then tell everyone you know, and their Granny, to read it too! It's just that good!' 'It was brilliant, I was gripped, absolutely loved it, bits of it I forgot to breathe as I was reading. One of the best books I've read in a long time' 'I don't even know where to start. This is by far THE BEST BOOK SJM HAS EVER WRITTEN' 'Another incredible book by my favourite author - the depths of the world she builds and each character are just indescribable - what a wonderful talent to have to write at this level - no one else is doing it better'",
