    "product_details": "Epson EcoTank ET-4856 Wifi Inkjet Printer Enjoy high-speed, business quality printing at an ultra-low cost with this multifunction inkjet with fax and ADF, perfect for home offices Supplied with high yield ink bottles, the integrated ink tanks are easy to fill thanks to the specially engineered ink bottles. With no cartridges to replace, flexible connectivity features, fax and ADF, this is the perfect printer for anyone looking for high-quality prints at an incredibly low cost per page. EcoTank provides hassle-free printing for homes and small offices - the ultrahigh capacity ink tanks allow mess-free refills and the key-lock bottles are designed so only the correct colour can be inserted. This economical printer saves you up to 90% on printing costs and comes with an extra black ink bottle for up to 3 years' worth of ink included in the box. One set of ink bottles delivers up to 7,500 pages in black and 6,000 in colour, equivalent of up to 72 cartridges worth of ink! Epson Smart Panel app enables you to control your printer from your smart device. You can print, copy and scan documents and photos, set up, monitor and troubleshoot your printer, all from your phone or tablet.Featuring a 6.1cm colour touchscreen, automatic double-sided printing and 30-page document feeder, fax, 250-page front paper tray and print speeds of up to 15.5 pages per minute, you can speed through a variety of tasks with ease. Featuring a compact design and full Wi-Fi, Wi-Fi Direct and Ethernet connectivity, you can easily integrate this printer with your existing home or office set-up and print from mobiles, tablets and laptops. Computers&Electronics, Printers&Scanners, Printers.",
