    "product_details": "This multifunction A4 printer delivers ultra-low printing costs and fast print speeds without the hassle of changing cartridges or toners. Designed for home offices and small businesses this feature-rich A4 printer delivers an ultra-low cost per page and ultra-fast print speeds. Thanks to the 250-sheet front paper tray, 6.1cm LCD touchscreen and 35-page automatic document feeder, you can just keep on printing. Get more done in less time Take your home office to the next level with this ultra-fast and efficient printer that can deliver a first page in as little as 7 seconds1. Feature-rich A4 EcoTank Print, copy and scan with the ET-5150 which features double-sided printing, a 250-sheet front paper tray and 35-page automatic document feeder. It's easy to navigate the extensive range of features with the 6.1cm LCD touchscreen. Keep on saving Making a saving every time you print with this EcoTank that delivers an incredibly low cost-per-page. Unlike other printers, EcoTank features large ink tanks that you fill with low-cost ink bottles. Business-quality printing The fast drying EcoTank 113 ink series features all pigment inks for smudge, water and highlighter resistant prints. From one set of replacement inks, you can produce up to 7,500 pages in black and 6,000 in colour2 Print from almost anywhere With Wi-Fi and Wi-Fi Direct, you can send documents to print from smart devices using the Epson iPrint and Smart Panel apps3. Easy to use and reliable Filling the ink tanks is simple with the resealable, intuitive and mess-free ink bottles. Epson’s unique Heat-Free PrecisionCore Technology offers improved reliability, reduced downtime and less environmental impact. No warm up time means the first page prints fast uses less power.",
