    "product_details": "The HP Envy 6030 is an affordable all-in-one printer for home use. Whether printing, scanning or copying, with WLAN and Bluetooth this is also possible wirelessly. The 100-sheet paper feeder can also handle larger print jobs and thanks to (optional) HP Instant Ink, the cost of ink cartridges is also reduced. Print at speeds of up to 10 pages per minute in black and white and 7 pages per minute in colour. With a very high native print resolution of 1200 x 1200 dpi, which can be optimised up to 4800 x 1200 dpi, you can enjoy razor-sharp prints with the finest colour gradations. This all-in-one printer impresses with many connection possibilities: Of course it can be connected directly to your computer via USB as a stand-alone device or you can use the wireless Wi-Fi or Bluetooth connection. Dual-band Wi-Fi not only improves range, but also speed and reliability. And with automatic reset, security is never compromised. You can also print directly from mobile devices. And with HP Smart App and AirPrint support, you can do it all. Wirelessly integrate the printer into your local network and share it without tangled cables. The integrated WLAN module makes it possible. With Instant Ink, HP has developed a flexible flat rate for ink cartridges. The printer automatically detects when the ink level is low and then triggers an order that arrives before the ink runs out. Not only does this make your life easier, it also saves you money. As an Instant Ink user, you can choose a page flat rate of 50, 100 or 300 pages per month. You can print these pages however you want - with pictures, text or graphics. If you print less pages in a month, HP will transfer your credit to the next month. And if your printing needs change, you can easily increase or decrease the number of pages at any time - or cancel the flat rate at any time.",
