    "product_details": "Black and Green 55mm Justin Sunglasses with Classic Lenses from Ray-Ban - RB41656017155 The Justin Wayfarer collection from Ray-Ban is the perfect set of shades for anyone with a retro style who is looking for that perfect vintage look. Justin sunglasses stand out by combining slightly oversized rectangle lenses with sleek, rubberized frames and polarized, gradient lenses. 100% UV Protection - Guaranteed Lots of sunglasses say they protect you from 100% UV, but not all of them actually do. Going with a name you can trust, like Ray-Ban, guarantees that you are really protecting yourself from 100% of UVA and UVB radiation. Why It’s Important to Have 100% Protection Ultraviolet light isn’t something to mess with. Especially when it comes to your eyes. UV can not only damage the skin around your eyes and eyelids, but it can damage the eye itself. The cornea, lens and other parts of the eye can be at risk of developing cataracts, growths and other issues with prolonged exposure. Stick with a leader in eyewear like Ray-Ban, and keep your eyes safe all year long. Gradient Lenses With colored gradient lenses, you get a smooth transition from a solid color to a transparent shade of that same color, top to bottom. Gradient lenses are great for driving, with the top portion darker to shield yourself from the sun, and clearer at the bottom so you can easily see your dash. Polarized for Performance These Justin sunglasses feature polarized lenses which reduce eye strain by… Eliminating glare Increasing visual clarity Enhancing contrast If you’re eyes aren’t straining against glare you’re less likely to experience discomfort or headaches so you can wear these sunglasses all day!",
