    "product_details": "The Ray-Ban brand is an icon in the eyewear market, popular with all generations around the globe. At the same time, Ray-Ban sunglasses are both fashionable and versatile accessories. They offer perfect protection for your eyes thanks to their original design and high-quality materials. Glasses from the Everglasses collection feature photochromic lenses with a blue light filter that provide protection against UV radiation and harmful blue light at the same time. Their photochromic lenses adapt to the surrounding UV radiation conditions. Depending on the UV radiation, the lenses automatically change from a clear to a dark tint within seconds. As soon as the intensity of the UV radiation decreases, the lenses become transparent again, but the UV protection remains. The light-sensitive spectacle lenses thus offer excellent UV protection in different climatic conditions, at any time of the year. This means you can always wear the same pair of glasses without having to sacrifice comfort. Learn more about the photochromic technology in our Complete Guide To Photochromic Lenses. In addition, the blue light filter integrated in the lenses provides excellent protection against harmful blue light emitted by digital devices such as computers, TVs, tablets or mobile phones. The so-called computer glasses help to reduce eye fatigue and burning, they minimise brightness and improve contrast. In this way, they provide eye protection combined with optimal visual comfort. Last but not least, Ray-Ban's high-quality materials guarantee high durability, resilience and maximum functionality. They offer 100% UV protection from sunlight and come with a Ray-Ban case and cleaning cloth.",
